import Coba from "./coba";
import LoginForm from './loginComponent';

const RegisterForm = () => {
    const Coba = (props) => {
        return (
            <h1> Hai {props.coba} </h1>
        );
    }
   
     const [pilih, setPilih] = useState({login : true})

     const handleClick = () => {
        setPilih({...pilih, login: !pilih.login})
     };
    
    return (

        <div>
            <React.Fragment>
                <Coba coba="To Do Lovers"/>
                <h2>Daftar Dulu YUks</h2>
                {pilih.login ? <LoginForm/> : <Coba/>}
                <button
                    className = "btn btn-dark"
                >

                </button>
            </React.Fragment>            
        </div>
    )
}

   


export default RegisterForm;
